import React from "react";
import Navbar from "../UI/Navbar";
import classes from "./Home.module.css";
const Home = () => {
    return(
        <React.Fragment>
            <Navbar btnText="Logout" className="btn-login"/>
            <h3>HOT Bookings</h3>
            <hr/>
        </React.Fragment>
    );
}

export default Home;
